import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route
        path="/"
        element={<RootLayout />}
        fallback={<ErrorPage />}
      >
        <Route index element={<HomePage />} />
        <Route
          path="events"
          element={<EventsRoot />}
        >
          <Route
            index
            element={<EventsPage />}
            loader={eventsLoader}
          />
          <Route
            path=":eventId"
            element={<EventDetailPage />}
            loader={eventDetailLoader}
            action={deleteEventAction}
          >
            <Route
              index
              element={<EventDetailPage />}
              action={deleteEventAction}
            />
            <Route
              path="edit"
              element={<EditEventPage />}
              action={manupualteAction}
            />
          </Route>
          <Route
            path="new"
            element={<NewEventPage />}
            action={manupualteAction}
          />
        </Route>
      </Route>
    </Routes>
  );
}

export default App;
